// src/components/Team.jsx
import React from 'react';

const Team = ({ team }) => {
  return (
    <div>
      {team.map(pokemon => (
        <div key={pokemon.id}>
          <h3>{pokemon.name}</h3>
        </div>
      ))}
    </div>
  );
};

export default Team;
